import { Link } from "react-router-dom";

const Category = () => {
  const names = ["개발", "개발2", "개발3", "게발게발", "개발ㄹㄹㄹ"];
  const nameList = names.map((name, index) => (
    <li key={index} class="Explore_CategoryItem__46TK9" /*id="gaebal"*/>
      <Link to="/gaebal">
        <em>{name}</em>
      </Link>
    </li>
  ));

  return <ul>{nameList}</ul>;
};

export default Category;
